objetoCompra:
Aferição de tempo - Contratação de solução para organização de atividade esportiva

A) Aferição de partida e chegada, com 1 ponto de controle, com 4 metros de antenas;

B) Ponto de controle no percurso com 04 metros de antenas;

C) Captura de imagens de chegada para verificação pós prova (backup de aferição de tempo);

D) 600 chips de uso único (descartáveis);

E) 600 kits contendo: número de peito com 3 serrilhas (impressão e/ou fundo colorido) com informativo de utilização de chip + 4 alfinetes + 1 envelope plástico transparente, etiquetados nominalmente; O modelo do número número de peito consta no anexo;

F) 1 relógio para pórtico de chegada (dupla face), com lâmpadas de LED para visualização à distância em dias claros e escuros;

G) Tenda 3 X 3 metros para partida e chegada com mesas e cadeiras;

H) Divulgação de resultados em site especializado no mesmo dia do evento, e em tempo real no local de prestação do serviço;

I) Transporte de material e hospedagem da equipe por conta da CONTRATADA; e

J) O envio dos kits e chips pela CONTRATADA deverá ocorrer em até 05 (cinco) dias após o recebimento da nota de empenho.

informacaoComplementar:
 Procuradoria-Geral do Estado de Rondônia (PGE/RO) conta com profissionais que atuam diretamente no planejamento, execução e acompanhamento das contratações públicas, atividades que exigem conhecimento técnico especializado e observância rigorosa às normas legais e aos princípios constitucionais da Administração Pública.

A participação permitirá uniformizar entendimentos, promover alinhamento conceitual e prático sobre a aplicação da Nova Lei de Licitações e Contratos e fortalecer a governança contratual no âmbito do Estado de Rondônia, assegurando maior segurança jurídica, economicidade e eficiência administrativa.

Nesse contexto, a presente contratação objetiva a inscrição de servidores da PGE/RO no “2º Congresso Nacional de Pareceristas e Assessores Jurídicos na Lei nº 14.133/2021”, promovido pelo Grupo CLG (Capacitação em Licitações e Gestão). O evento será realizado nos dias 10, 11 e 12 de setembro de 2025, no Rio de Janeiro/RJ, em formato presencial, com carga horária de 21 horas, reunindo renomados especialistas nacionais na temática.

O conteúdo programático abrange, entre outros tópicos:

A Nova Lei de Licitações em Foco: da fase preparatória estratégica à execução contratual segura;

Inovação e transformação digital nas compras públicas: marketplace, inteligência artificial e novas ferramentas;

Governança, controles e combate à fraude nas licitações;

Responsabilidade e atuação estratégica da assessoria jurídica: limites, prerrogativas e defesa do interesse público;

Desafios complexos e soluções inovadoras em licitações e contratos;

Assessoria jurídica estratégica nas empresas estatais.

A metodologia compreende palestras, painéis temáticos, debates interativos e networking com especialistas, além de material de apoio, grupo exclusivo para atualização permanente e emissão de certificado individual.
